import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div>
            <h1>Welcome to the Employee Management System</h1>
            <nav>
                <ul>
                    <li><Link to="/login">Login</Link></li>
                </ul>
            </nav>
        </div>
    );
};

export default HomePage;
